import React from "react";
import "./nav.css";
import home from "../assets/images/home.svg";
import NavButton from "./NavButton";
import { useNavigate } from "react-router-dom";
const Nav=(props)=>{
    const navigate=useNavigate();
    const activeHome=()=>{
        if(props.pageName==="home"){
            document.querySelector('.homeBtn').innerHTML="Home <img//>";

            return "navBtnActive";
        }
        else{
            return "active";
        }
    }

    const homeContent=()=>{
        if(props.pageName==="home"){
            return "Home "+ `<img src=""/>`;
        }
        else{
            return "Home";
        }
    }
    const activePeers=()=>{
        if(props.pageName==="peers"){
            return "navBtnActive";
        }
        else{
            return "active";
        }
    }
    const activeSearch=()=>{
        if(props.pageName==="search"){
            return "navBtnActive";
        }
        else{
            return "active";
        }
    }
    const activeNotif=()=>{
        if(props.pageName==="notif"){
            return "navBtnActive";
        }
        else{
            return "active";
        }
    }
    const activeProfile=()=>{
        if(props.pageName==="profile"){
            return "navBtnActive";
        }
        else{
            return "active";
        }
    }
    const navigateHome=()=>{
        console.log("Home button clicked");
        navigate("/studentHome");

    }

    const navigatePeers=()=>{
        console.log("Connections button clicked");
        navigate("/studentPeers");
    }

    const navigateSearch=()=>{
        console.log("Search button clicked");
    }

    const navigateNotif=()=>{
        console.log("Notifications button clicked");
    }

    const navigateProfile=()=>{
        console.log("Profile button clicked");
    }
    return(
        <nav>
            <ul>
                <li><NavButton className={activeHome()} label={homeContent()} name="homeBtn" onClick={navigateHome} /></li>
                <li><NavButton className={activePeers()} label="Peers" name="peersBtn" onClick={navigatePeers}/></li>
                <li><NavButton className={activeSearch()} label="Search" name="searchBtn" onClick={navigateSearch} /></li>
                <li><NavButton className={activeNotif()} label="Notif" name="notiBtn" onClick={navigateNotif}/></li>
                <li><NavButton className={activeProfile()} label="Profile" name="profileBtn" onClick={navigateProfile}/></li>
            </ul>
        </nav>
    )
}
export default Nav;
